-- Criação de Functions
-- Inserir mercado
CREATE OR REPLACE FUNCTION insertmercado(nome VARCHAR(15),  endBairro VARCHAR(20), endRua VARCHAR(35)) 
RETURNS VOID AS $$
    DECLARE
        cod INT;
	BEGIN
		   SELECT * INTO cod FROM instArrecadacao ORDER BY codInst DESC LIMIT 1;
    END;
$$ LANGUAGE plpgsql;

-- Chamando a function insertmercado
select insertmercado(nome,  endBairro , endRua)

-- Inserir Bairro
CREATE OR REPLACE FUNCTION insertbairro(endBairro VARCHAR(20)) 
RETURNS VOID AS $$
    DECLARE
        cod INT;
	BEGIN
		   SELECT * INTO cod FROM instArrecadacao ORDER BY codInst DESC LIMIT 1;
    END;
$$ LANGUAGE plpgsql;

-- Chamando a function insertbairro
select insertbairro(endBairro)


-- Calcular a quantidade total de produtos arrecadados
CREATE OR REPLACE FUNCTION quantProdutosArrecadados ()
    RETURNS INT AS $total$
    declare
        total INT;
    BEGIN
       SELECT count(quantidade) INTO total FROM campanhaArrecadacao;
       RETURN total;
    END;
$total$ LANGUAGE plpgsql;

-- Chamando a function quantProdutosArrecadados
select quantProdutosArrecadados();


-- Calcular a quantidade total de produtos arrecadados em um dado dia
CREATE OR REPLACE FUNCTION quantProdutosArrecadadospDia(dataescolhida DATE)
    RETURNS INT AS $total$
    declare
        total INT;
    BEGIN
       SELECT count(c.quantidade) INTO total FROM campanhaArrecadacao c WHERE c.data = dataescolhida;
       RETURN total;
    END;
$total$ LANGUAGE plpgsql;

-- Chamando a function quantProdutosArrecadados
select quantProdutosArrecadadospDia();


